import React from 'react';

function DisplayData(props){
    const elements = props.elements;
    const listData = elements.map(item =>{
        return <div key={item.id}>
            <p> 
                {item.name}
                {item.age}
                {item.grade}
                {item.gender}
            </p>

        </div>
    })
          return (
              <div> {listData} </div>
          )
}


